import {Routes, Route, useNavigate} from 'react-router-dom';
import './App.css';
import LandingPage from './pages/landing';


function App() {
  const navigate = useNavigate();

  const navigateToMain = () => {
    navigate('./pages/landing');
  }

  return (
    <LandingPage navigateToMain={navigateToMain}/>
  )
}

export default App;
